import React from "react";
import {Link  } from "react-router-dom";
export default function Turler() {
  return (
    <div style={{
        width:"1000px",
        height:"500px",
        display: "inline-block",
    }}>
        <Link to={`/tur/cavalier-king-charles-spaniel`}>
            <b>Cavalier King Charles Spaniel</b>
          </Link><br/>
          <Link to={`/tur/golden-retriever`}>
            <b>Golden Retriever</b>
          </Link><br/>
          <Link to={`/tur/chihuahua`}>
            <b>Chihuahua</b>
          </Link><br/>
          <Link to={`/tur/shepherd`}>
            <b>Shepherd</b>
          </Link><br/>
          <Link to={`/tur/others`}>
            <b>Others</b>
          </Link><br/>

          <ListGroup>
                <ListGroupItem>
                    {filteredDogs.map((dog) => {
                        return (
                            <ListGroupItem>
                                <Link to={`/detay/${dog.id}/${dog.name}`}>
                                    <h5>{dog.name}</h5>
                                </Link>
                                </ListGroupItem>
                        );
                    })}
                </ListGroupItem>
            </ListGroup>



          <hr/>
            <Link to={`/`}><h6>Return Homepage</h6></Link>
    </div>
  );
}
